import React from 'react';
import { connect } from 'react-redux';

const App = (props) => {
    console.log(props);
    if(!props.user) {
        return <div>Not logged in</div>
    }
    return <div>Logged in</div>
};

const mapStateToProps = (state) => {
    return {
        user: state.user
    };
};

export default connect(mapStateToProps)(App);
